                <h6><u>Adding new totem</u></h6>
                <p>
    ");
            WriteLiteral(@"                To add a new totem to the database you need to have full information about the totem. A totem is made up of
                    the following attributes
                </p>
                <ul class=""list-group-flush"">
                    <li ><span class=""blue-txt"">ID</span> - there are so many variants for each animal (or totem) for example ""chirandu"" for the ""moyo"" totem. </li>
                    <li><span class=""blue-txt"">NAME</span> - this is the name of the animal (or ttem e.g. ""Shumba"").</li>
                    <li><span class=""blue-txt"">ORIGIN</span> - some totems originated in particular districts or provinces. </li>
                    <li><span class=""blue-txt"">DESCRIPTION</span> - Some interesting things about the totem for example how it originated and what it symbolyses.</li>
                    <li><span class=""blue-txt"">IMAGE</span> - a url that links to an image resource for the totem.</li>
                    <li><span class=""blue-txt"">BODY</span> - the actual tot");
            WriteLiteral(@"em body.</li>
                </ul>
                <p>
                    Once you have the above information you can add it to the database using this <a href=""#"" data-toggle=""modal"" data-target=""#addModal"">link</a>.
                    You should get a pop up confirming that the new totem has been successfully added.
                </p>

                <hr />

                <h6><u>Updating an existing totem</u></h6>

                <p>
                    For one to update an existing totem you have to know the <strong>ID </strong> and the <strong>KEY</strong> or <strong>FIELD</strong> of the totem you want to update.
                    If you have no clue visit the Json List of existing totems <a href=""https://localhost:44318/totems"">here</a>. To update the information click <a href=""#"" data-toggle=""modal"" data-target=""#mymodal"">Update</a>
                </p>

